  false,\n\t\"url\": null,\n\t\"notes\": \"The Antarctic Oscillation (AAO) is a leading
  teleconnection pattern in the Southern Hemisphere circulation. It is calculated
  as the first Empirical Orthogonal Function (EOF) for height anomalies poleward of
  20 degrees latitude for the Southern Hemisphere. The goal of the EOF procedure is
  to capture the maximum amount of explained variance in the circulation fields.\",\n\t\"license_title\":
